package org.jfree.data;

import java.io.Serializable;
import org.jfree.chart.util.ParamChecks;

/**
 * Represents an immutable range of values.
 */
public strictfp class Range implements Serializable {

    /** For serialization. */
    private static final long serialVersionUID = -906333695431863380L;

    /** The lower bound of the range. */
    private double lower;

    /** The upper bound of the range. */
    private double upper;

    /**
     * Creates a new range.
     *
     * @param lower  the lower bound (must be &lt;= upper bound).
     * @param upper  the upper bound (must be &gt;= lower bound).
     */
    public Range(double lower, double upper) {
        if (lower > upper) {
            String msg = "Range(double, double): require lower (" + lower
                + ") <= upper (" + upper + ").";
            throw new IllegalArgumentException(msg);
        }
        this.lower = lower;
        this.upper = upper;
    }

    /**
     * Returns the lower bound for the range.
     *
     * @return The lower bound.
     */
    public double getLowerBound() {
        return this.lower;
    }

    /**
     * Returns the upper bound for the range.
     *
     * @return The upper bound.
     */
    public double getUpperBound() {
        return this.upper;
    }

    /**
     * Returns the length of the range.
     *
     * @return The length.
     */
    public double getLength() {
        return this.upper - this.lower;
    }

    /**
     * Returns the central value for the range.
     *
     * @return The central value.
     */
    public double getCentralValue() {
        return this.lower / 2.0 + this.upper / 2.0;
    }

    /**
     * Returns <code>true</code> if the range contains the specified value and
     * <code>false</code> otherwise.
     *
     * @param value  the value to lookup.
     *
     * @return <code>true</code> if the range contains the specified value.
     */
    public boolean contains(double value) {
        return (value >= this.lower && value <= this.upper);
    }

    /**
     * Returns <code>true</code> if the range intersects with the specified
     * range, and <code>false</code> otherwise.
     *
     * @param b0  the lower bound (should be &lt;= b1).
     * @param b1  the upper bound (should be &gt;= b0).
     *
     * @return A boolean.
     */
    public boolean intersects(double b0, double b1) {
        if (b0 <= this.lower) {
            return (b1 > this.lower);
        }
        else {
            return (b0 < this.upper && b1 >= b0);
        }
    }

    /**
     * Returns <code>true</code> if the range intersects with the specified
     * range, and <code>false</code> otherwise.
     *
     * @param range  another range (<code>null</code> not permitted).
     *
     * @return A boolean.
     *
     * @since 1.0.9
     */
    public boolean intersects(Range range) {
        return intersects(range.getLowerBound(), range.getUpperBound());
    }

    /**
     * Returns the value within the range that is closest to the specified
     * value.
     *
     * @param value  the value.
     *
     * @return The constrained value.
     */
    public double constrain(double value) {
        double result = value;
        if (!contains(value)) {
            if (value > this.upper) {
                result = this.upper;
            }
            else if (value < this.lower) {
                result = this.lower;
            }
        }
        return result;
    }

    /**
     * Creates a new range by combining two existing ranges.
     * <P>
     * Note that:
     * <ul>
     *   <li>either range can be <code>null</code>, in which case the other
     *       range is returned;</li>
     *   <li>if both ranges are <code>null</code> the return value is
     *       <code>null</code>.</li>
     * </ul>
     *
     * @param range1  the first range (<code>null</code> permitted).
     * @param range2  the second range (<code>null</code> permitted).
     *
     * @return A new range (possibly <code>null</code>).
     */
    public static Range combine(Range range1, Range range2) {
        if (range1 == null) {
            return range2;
        }
        if (range2 == null) {
            return range1;
        }
        double l = Math.min(range1.getLowerBound(), range2.getLowerBound());
        double u = Math.max(range1.getUpperBound(), range2.getUpperBound());
        return new Range(l, u);
    }

    /**
     * Returns a new range that spans both <code>range1</code> and 
     * <code>range2</code>.  This method has a special handling to ignore
     * Double.NaN values.
     *
     * @param range1  the first range (<code>null</code> permitted).
     * @param range2  the second range (<code>null</code> permitted).
     *
     * @return A new range (possibly <code>null</code>).
     *
     * @since 1.0.15
     */
    public static Range combineIgnoringNaN(Range range1, Range range2) {
        if (range1 == null) {
            if (range2 != null && range2.isNaNRange()) {
                return null;
            }
            return range2;
        }
        if (range2 == null) {
            if (range1.isNaNRange()) {
                return null;
            }
            return range1;
        }
        double l = min(range1.getLowerBound(), range2.getLowerBound());
        double u = max(range1.getUpperBound(), range2.getUpperBound());
        if (Double.isNaN(l) && Double.isNaN(u)) {
            return null;
        }
        return new Range(l, u);
    }
    
    /**
     * Returns the minimum value.  If either value is NaN, the other value is 
     * returned.  If both are NaN, NaN is returned.
     * 
     * @param d1  value 1.
     * @param d2  value 2.
     * 
     * @return The minimum of the two values. 
     */
    private static double min(double d1, double d2) {
        if (Double.isNaN(d1)) {
            return d2;
        }
        if (Double.isNaN(d2)) {
            return d1;
        }
        return Math.min(d1, d2);
    }

    private static double max(double d1, double d2) {
        if (Double.isNaN(d1)) {
            return d2;
        }
        if (Double.isNaN(d2)) {
            return d1;
        }
        return Math.max(d1, d2);
    }

    /**
     * Returns a range that includes all the values in the specified
     * <code>range</code> AND the specified <code>value</code>.
     *
     * @param range  the range (<code>null</code> permitted).
     * @param value  the value that must be included.
     *
     * @return A range.
     *
     * @since 1.0.1
     */
    public static Range expandToInclude(Range range, double value) {
        if (range == null) {
            return new Range(value, value);
        }
        if (value < range.getLowerBound()) {
            return new Range(value, range.getUpperBound());
        }
        else if (value > range.getUpperBound()) {
            return new Range(range.getLowerBound(), value);
        }
        else {
            return range;
        }
    }

    /**
     * Creates a new range by adding margins to an existing range.
     *
     * @param range  the range (<code>null</code> not permitted).
     * @param lowerMargin  the lower margin (expressed as a percentage of the
     *                     range length).
     * @param upperMargin  the upper margin (expressed as a percentage of the
     *                     range length).
     *
     * @return The expanded range.
     */
    public static Range expand(Range range,
                               double lowerMargin, double upperMargin) {
        ParamChecks.nullNotPermitted(range, "range");
        double length = range.getLength();
        double lower = range.getLowerBound() - length * lowerMargin;
        double upper = range.getUpperBound() + length * upperMargin;
        if (lower > upper) {
            lower = lower / 2.0 + upper / 2.0;
            upper = lower;
        }
        return new Range(lower, upper);
    }

    /**
     * Shifts the range by the specified amount.
     *
     * @param base  the base range (<code>null</code> not permitted).
     * @param delta  the shift amount.
     *
     * @return A new range.
     */
    public static Range shift(Range base, double delta) {
        return shift(base, delta, false);
    }

    /**
     * Shifts the range by the specified amount.
     *
     * @param base  the base range (<code>null</code> not permitted).
     * @param delta  the shift amount.
     * @param allowZeroCrossing  a flag that determines whether or not the
     *                           bounds of the range are allowed to cross
     *                           zero after adjustment.
     *
     * @return A new range.
     */
    public static Range shift(Range base, double delta,
                              boolean allowZeroCrossing) {
        ParamChecks.nullNotPermitted(base, "base");
        if (allowZeroCrossing) {
            return new Range(base.getLowerBound() + delta,
                    base.getUpperBound() + delta);
        }
        else {
            return new Range(shiftWithNoZeroCrossing(base.getLowerBound(),
                    delta), shiftWithNoZeroCrossing(base.getUpperBound(),
                    delta));
        }
    }

    /**
     * Returns the given <code>value</code> adjusted by <code>delta</code> but
     * with a check to prevent the result from crossing <code>0.0</code>.
     *
     * @param value  the value.
     * @param delta  the adjustment.
     *
     * @return The adjusted value.
     */
    private static double shiftWithNoZeroCrossing(double value, double delta) {
        if (value > 0.0) {
            return Math.max(value + delta, 0.0);
        }
        else if (value < 0.0) {
            return Math.min(value + delta, 0.0);
        }
        else {
            return value + delta;
        }
    }

    /**
     * Scales the range by the specified factor.
     *
     * @param base the base range (<code>null</code> not permitted).
     * @param factor the scaling factor (must be non-negative).
     *
     * @return A new range.
     *
     * @since 1.0.9
     */
    public static Range scale(Range base, double factor) {
        ParamChecks.nullNotPermitted(base, "base");
        if (factor < 0) {
            throw new IllegalArgumentException("Negative 'factor' argument.");
        }
        return new Range(base.getLowerBound() * factor,
                base.getUpperBound() * factor);
    }

    /**
     * Tests this object for equality with an arbitrary object.
     *
     * @param obj  the object to test against (<code>null</code> permitted).
     *
     * @return A boolean.
     */
    @Override
    public boolean equals(Object obj) {
        if (!(obj instanceof Range)) {
            return false;
        }
        Range range = (Range) obj;
        if (!(this.lower == range.lower)) {
            return false;
        }
        if (!(this.upper == range.upper)) {
            return false;
        }
        return true;
    }

    /**
     * Returns <code>true</code> if both the lower and upper bounds are 
     * <code>Double.NaN</code>, and <code>false</code> otherwise.
     * 
     * @return A boolean.
     * 
     * @since 1.0.18
     */
    public boolean isNaNRange() {
        return Double.isNaN(this.lower) && Double.isNaN(this.upper);
    }
    
    /**
     * Returns a hash code.
     *
     * @return A hash code.
     */
    @Override
    public int hashCode() {
        int result;
        long temp;
        temp = Double.doubleToLongBits(this.lower);
        result = (int) (temp ^ (temp >>> 32));
        temp = Double.doubleToLongBits(this.upper);
        result = 29 * result + (int) (temp ^ (temp >>> 32));
        return result;
    }

    /**
     * Returns a string representation of this Range.
     *
     * @return A String "Range[lower,upper]" where lower=lower range and
     *         upper=upper range.
     */
    @Override
    public String toString() {
        return ("Range[" + this.lower + "," + this.upper + "]");
    }

}

package Test;

import org.jfree.data.Range;
import org.junit.Assert;
import org.junit.Test;

public class TestRange {
	@Test
	public void testCombine_WithTwoSameRange()
	{
		Range aRange1 = new Range(0, 0);
		Range aRange2 = new Range(0, 0);
		Range result = Range.combine(aRange1, aRange2);
		Assert.assertEquals(0, result.getLength(), 0.000001);
		Assert.assertEquals(0, result.getLowerBound(), 0.000001);
		Assert.assertEquals(0, result.getUpperBound(), 0.000001);
		Assert.assertEquals(0, result.getCentralValue(), 0.000001);
	}
	
	@Test
	public void testCombine_WithTwoIntersectRange()
	{
		Range aRange1 = new Range(-1, 1);
		Range aRange2 = new Range(-0.5, 5);
		Range result = Range.combine(aRange1, aRange2);
		Assert.assertEquals(6, result.getLength(), 0.000001);
		Assert.assertEquals(-1, result.getLowerBound(), 0.000001);
		Assert.assertEquals(5, result.getUpperBound(), 0.000001);
		Assert.assertEquals(2, result.getCentralValue(), 0.000001);
	}
	
	@Test
	public void testCombine_WithTwoUnintersectRange()
	{
		Range aRange1 = new Range(-1, 0);
		Range aRange2 = new Range(0, 9);
		Range result = Range.combine(aRange1, aRange2);
		Assert.assertEquals(10, result.getLength(), 0.000001);
		Assert.assertEquals(-1, result.getLowerBound(), 0.000001);
		Assert.assertEquals(9, result.getUpperBound(), 0.000001);
		Assert.assertEquals(4, result.getCentralValue(), 0.000001);
	}
	
	@Test
	public void testConstrain()
	{
		Range aRange = new Range(-1, 1);
		Assert.assertEquals(1, aRange.constrain(1), 0.000001);
		Assert.assertEquals(-1, aRange.constrain(-1), 0.000001);
		Assert.assertEquals(0, aRange.constrain(0), 0.000001);
		Assert.assertEquals(0.1, aRange.constrain(0.1), 0.000001);
		Assert.assertEquals(-0.1, aRange.constrain(-0.1), 0.000001);
		Assert.assertEquals(1, aRange.constrain(99), 0.000001);
		Assert.assertEquals(-1, aRange.constrain(-99), 0.000001);
	}
	
	@Test
	public void testContains()
	{
		Range aRange = new Range(-1, 1);
		Assert.assertFalse(aRange.contains(-1.1));
		Assert.assertTrue(aRange.contains(-1));
		Assert.assertTrue(aRange.contains(0));
		Assert.assertTrue(aRange.contains(1));
		Assert.assertFalse(aRange.contains(1.1));
	}
	
	@Test
	public void testGetCentralValue_WithNegativeRange()
	{
		Range aRange = new Range(-10, -5);
		Assert.assertEquals(-7.5, aRange.getCentralValue(), 0.000001);
	}
	
	@Test
	public void testGetCentralValue_WithNegativeAndPositiveRange()
	{
		Range aRange = new Range(-8, 6);
		Assert.assertEquals(-1, aRange.getCentralValue(), 0.000001);
	}
	
	@Test
	public void testGetCentralValue_WithPositiveRange()
	{
		Range aRange = new Range(1, 6);
		Assert.assertEquals(3.5, aRange.getCentralValue(), 0.000001);
	}
	
	@Test
	public void testGetLength_WithNegativeRange()
	{
		Range aRange = new Range(-10, -5);
		Assert.assertEquals(5, aRange.getLength(), 0.000001);
	}
	
	@Test
	public void testGetLength_WithNegativeAndPositiveRange()
	{
		Range aRange = new Range(-8, 6);
		Assert.assertEquals(14, aRange.getLength(), 0.000001);
	}
	
	@Test
	public void testGetLength_WithPositiveRange()
	{
		Range aRange = new Range(1, 6);
		Assert.assertEquals(5, aRange.getLength(), 0.000001);
	}
}

package Test;

import java.io.IOException;
import java.io.StringReader;

import org.junit.Assert;
import org.junit.Test;
import org.jfree.data.category.CategoryDataset;
import org.jfree.data.io.CSV;;

public class TestCSV {

	@Test
	public void testReadCategoryDataset() throws IOException
	{
		CSV csv = new CSV();
		StringReader stringReader = new StringReader(" , A,B\nC,1,2\nD,3,4");
		CategoryDataset categoryDataset = csv.readCategoryDataset(stringReader);
		Assert.assertEquals(2, categoryDataset.getColumnKeys().size());
		Assert.assertEquals(2, categoryDataset.getRowKeys().size());
		Assert.assertEquals(1.0, categoryDataset.getValue(0, 0));
		Assert.assertEquals(2.0, categoryDataset.getValue(0, 1));
		Assert.assertEquals(3.0, categoryDataset.getValue(1, 0));
		Assert.assertEquals(4.0, categoryDataset.getValue(1, 1));
	}
}
